import "./styles.css";
import content from "./content";
import { parse } from "node-html-parser";
import parser from "./richTextParser";

// nodtype 1:标签 3:文字
import {
  Document,
  Packer,
  Paragraph,
  TextRun,
  AlignmentType,
  HeadingLevel,
  ShadingType,
  ImageRun
} from "docx";
const button = document.getElementById("button");

const root = parse(content.cards[1].html);
// console.log("xx root: ", root);
const result = parser(root);
// console.log("result: ", result);
// Documents contain sections, you can have multiple sections per document, go here to learn more about sections
// This simple example will only contain one section
const sections = [
  {
    properties: {},
    children: [
      new Paragraph({
        text: "Hello World",
        heading: HeadingLevel.TITLE,
        alignment: AlignmentType.CENTER
      }),
      ...result
    ]
  },
  {
    children: [
      new Paragraph({
        text: "Hey you",
        numbering: {
          reference: "my-crazy-numbering",
          level: 0
        }
      }),
      new Paragraph({
        text: "What's up fam",
        numbering: {
          reference: "my-crazy-numbering",
          level: 1
        }
      }),
      new Paragraph({
        text: "Hello World 2",
        numbering: {
          reference: "my-crazy-numbering",
          level: 1
        }
      }),
      new Paragraph({
        text: "Yeah boi",
        numbering: {
          reference: "my-crazy-numbering",
          level: 2
        }
      }),
      new Paragraph({
        text: "Hey you",
        bullet: {
          level: 0
        }
      }),
      new Paragraph({
        text: "What's up fam",
        bullet: {
          level: 1
        }
      }),
      new Paragraph({
        text: "Hello World 2",
        bullet: {
          level: 2
        }
      }),
      new Paragraph({
        text: "Yeah boi",
        bullet: {
          level: 3
        }
      }),
      new Paragraph({
        text: "101 MSXFM",
        numbering: {
          reference: "my-crazy-numbering",
          level: 3
        }
      }),
      new Paragraph({
        text: "back to level 1",
        numbering: {
          reference: "my-crazy-numbering",
          level: 1
        }
      }),
      new Paragraph({
        text: "back to level 0",
        numbering: {
          reference: "my-crazy-numbering",
          level: 0
        }
      }),
      new Paragraph({
        children: [
          new TextRun("第二段"),
          new ImageRun({
            data:
              "data:image/png;base64,",
            transformation: {
              width: 100,
              height: 100
            }
          })
        ]
      })
    ]
  }
];
const doc = new Document({
  title: content.title,
  numbering: {
    config: [
      {
        reference: "my-crazy-numbering",
        levels: [
          {
            level: 0,
            format: "decimal",
            text: "%1",
            alignment: AlignmentType.START,
            style: {
              paragraph: {
                indent: { left: 720, hanging: 260 }
              }
            }
          },
          {
            level: 1,
            format: "decimal",
            text: "%2.",
            alignment: AlignmentType.START,
            style: {
              paragraph: {
                indent: { left: 1440, hanging: 980 }
              }
            }
          },
          {
            level: 2,
            format: "lowerLetter",
            text: "%3)",
            alignment: AlignmentType.START,
            style: {
              paragraph: {
                indent: { left: 2160, hanging: 1700 }
              }
            }
          },
          {
            level: 3,
            format: "upperLetter",
            text: "%4)",
            alignment: AlignmentType.START,
            style: {
              paragraph: {
                indent: { left: 2880, hanging: 2420 }
              }
            }
          }
        ]
      }
    ]
  },
  sections
});

button.addEventListener("click", () => {
  // Used to export the file into a .docx file
  Packer.toBlob(doc).then((blob) => {
    let url = URL.createObjectURL(blob);
    let a = document.createElement("a");
    a.setAttribute("download", url);
    a.href = url;
    a.download = `${"模型计算结果"}.doc`;
    a.style.display = "none";
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  });
});

